import React from 'react';

const Settings = ({ onClose }) => {
  return (
    <>
      <div className="modal-overlay" onClick={onClose}></div>
      <div className="modal settings">
        <h2>Налаштування</h2>
        <button onClick={onClose}>Закрити</button>
      </div>
    </>
  );
};

export default Settings;
